import ProjectTile from "./ProjectTile"

const project = [1, 2, 3, 4, 5];

function ProjectPreviews(){
    return (
  <div id="projWindow">
    <section id="projects">


    {project.map(project => (
        <ProjectTile />
      ))}
    </section>
    <div class="seeMore">
      <ul>
        <li id="seeMore" class="colorchange"><a href=""><li id="seeMore" class="colorchange">see more</li></a></li>
      </ul>
    </div>
  </div>
    )
}

export default ProjectPreviews;
